        <div className="app-name">SixHearts</div>
        <nav className="nav-links">
            {!isLoggedIn ? (
            <>
                <a href="/login" className="nav-link">Login</a>
                {/* Otros enlaces del encabezado */}
            </>
            ) : (
            <>
                {/* Enlaces para usuarios logueados */}
            </>
            )}
        </nav>
        </header>
    );
    }

    export default Header;
